"telefono" varchar(100),
"municipio" varchar(100),
"horario" varchar(254),
"categoria" varchar(100),
"marca" varchar(100));
ALTER TABLE "clinicas" ADD PRIMARY KEY (gid);
SELECT AddGeometryColumn('','clinicas','the_geom','4326','POINT',2);
